import React from 'react'
import Link from 'next/link';

const Navbar = () => {
  return (
    <div>
      <ul>
        <li>
          <Link href="/about">
            <a>About Page</a>
          </Link>
        </li>
        <li>
          <Link href="/">
            <a>home Page</a>
          </Link>
        </li>
      </ul>

      <style jsx>{`
        ul {
          background: #333;
          color: #fff;
          list-style: none;
          display: flex;
        }
        ul li {
          font-size: 18px;
          margin-right: 20px;
        }
        ul li a {
          color: #fff
        }
      `}
      </style>
    </div>
  )
}

export default Navbar
